import logo from './logo.svg';
import './App.css';
import ImageService from './src/services/imageService';

import Grid from './components/grid';

function App() {
  const [hasInitialized, setHasInitialized] = useState(false);

  useEffect(() => {
    if (!hasInitialized) {
      ImageService.init();
      setHasInitialized(true);
    }
  });

  return (
    <div className="App">
      <Grid />
    </div>
  );
}

export default App;
